import {BrowserRouter as Router, Route, Switch} from "react-router-dom";
import 'bootstrap';
import {Container} from "react-bootstrap";
import Landing from "./components/Landing";


function App() {
  return(
      <Router>
          <>
              <Route exact path='/'>
                  <Landing/>
              </Route>
              <Switch>
                    <Route exact path='/login'></Route>
              </Switch>
          </>
      </Router>
  );
}

export default App;
